    const [formData, setFormData] = useState({})

    const updateInput = e => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        })
    }

    return (
        <>
            <ReviewFormContainer>
                <ReviewFormWrapper>
                    <ReviewFormContent>
                        <div>
                        </div>
                    </ReviewFormContent>
                    <ReviewFormFormField>
                        <Form />
                    </ReviewFormFormField>
                </ReviewFormWrapper>
            </ReviewFormContainer>
        </>
    )
}

